import { signOut } from "firebase/auth";
import React from "react"; 

const Navbar = () => {
    return (
        <div className="navbar">
            <span className="logo">Let's Chat!
            </span>
            <div className="user">
                <img src="" alt=""/>
                <span>Sid</span>
                <button onClick={()=>signOut()}>Logout</button>
            </div>
        </div>
    )
}

export default Navbar;
